import React from "react";
import {
  Container,
  Row,
  Col,
  FormGroup,
  Input,
  Button,
  Form,
} from "reactstrap";
import { useForm, Controller } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import * as yup from "yup";
import { useDispatch } from "react-redux";

const Register = () => {
  return (
    <div>
      <Col md={6} className="register-box">
        <Row>
          <h4 className="signin-title">BUYER</h4>
        </Row>
        <Form onSubmit={handleSubmit(onsubmit)} className="login-form">
          <FormGroup>
            <Controller
              as={Input}
              type="text"
              name="username"
              defaultValue=""
              placeholder="username"
              control={control}
              refs={register}
            />
          </FormGroup>
          <FormGroup>
            <Controller
              as={Input}
              type="email"
              name="email"
              defaultValue=""
              placeholder="E-mail"
              control={control}
              refs={register}
            />
          </FormGroup>
          <FormGroup>
            <Controller
              as={Input}
              type="password"
              name="password"
              defaultValue=""
              placeholder="password"
              control={control}
              refs={register}
            />
          </FormGroup>
          <FormGroup>
            <Button className="signin-button">REGISTER</Button>
          </FormGroup>
        </Form>
      </Col>
    </div>
  );
};

export default Register;
